y=new A.mQ(R.cp([],[new R.aE(C.eX,"MaterialButtonExample","material_button_example/lib/material_button_example.dart")],[new R.aK("MaterialButtonComponent","material-button","angular_components/lib/material_button/material_button.dart",'<p>A flat or raised button with an optional ripple effect.</p>\n<p><strong>Example usage:</strong></p>\n<pre><code class="language-html">&lt;!-- A button with both icon and text --&gt;\n&lt;material-button (trigger)="generateNames()"&gt;\n    &lt;material-icon icon="lightbulb_outline"&gt;&lt;/material-icon&gt;\n    Get new ideas\n&lt;/material-button&gt;\n</code></pre>\n<p><strong>Attributes:</strong></p>\n<p>The following attributes are commonly used with <code>&lt;material-button&gt;</code>:</p><ul><li><code>disabled</code>: If present, sets the [disabled] property to true. If the\n<code>disabled</code> property is true, this attribute is present.</li><li><code>raised</code>:  If present, sets the [raised] property to true. If the\n<code>raised</code> property is true, this attribute is present.</li><li><code>icon</code>: If present, removes the minimum width style of the button.\nTo specify the actual icon in the button, use a <code>&lt;glyph&gt;</code>,\n<code>&lt;material-icon&gt;</code>, or <code>&lt;img&gt;</code>.</li><li><code>no-ink</code>: If present, removes the ripple effect from the button.</li><li><code>clear-size</code>: If present, removes both <code>min-width</code> and <code>margin</code> from\nthe button.</li><li><code>dense</code>: If present, reduces <code>font-size</code> to 13px and button height to\n32px.</li></ul>\n<p><strong>Properties:</strong></p>\n<p>The following properties are frequently used:</p><ul><li><code>disabled</code> -- True if the button should not respond to events, and\nshould have a style that suggests that interaction is not allowed.</li><li><code>raised</code> -- True if the button should have a box shadow that makes the\nbutton look raised.</li></ul>\n<p><strong>Events:</strong></p>\n<p>To react to button clicks, handle the trigger event:</p><ul><li><code>trigger</code> -- Fired when the button is activated via click, tap, or\nkey press.</li></ul>\n<p><strong>Styling:</strong></p>\n<p>The preferred way of specifying button colors is to use mixins:</p>\n<pre><code>/* Make #myButton green with yellow text */\n@include button-background-color(\'#myButton\', green);\n@include button-color(\'#myButton\', yellow);\n</code></pre>\n<p>The advantage of using mixins for color is that they will not overwrite the\ndisabled state colors. You can also style the button with CSS as you would a\nnormal DOM element, although this will also affect the disabled state:</p>\n<pre><code>/* Make #myButton green with yellow text */\n#myButton {\n  background: green;\n  color: yellow;\n}\n</code></pre>\n<p>By default the ripple is the same color as the foreground at 25% opacity.\nTo customize the color, use the <code>material-ripple</code> selector:</p>\n<pre><code>/* Make #myButton use a blue ripple instead of foreground color */\n#myButton material-ripple {\n  color: blue;\n}\n</code></pre>\n<p>The opacity of the ripple is not customizable via CSS.</p>\n<p><strong>See also:</strong></p>\n<p>Examples:</p><ul><li><a href="https://github.com/dart-lang/io_2017_components_codelab/tree/master">dart-lang/io_2017_components_codelab repo</a></li></ul>\n<p>Other resources:</p><ul><li><a href="https://codelabs.developers.google.com/codelabs/your-first-angulardart-web-app/">Material design codelab</a></li></ul>\n'),new R.aK("MaterialFabComponent","material-fab","angular_components/lib/material_button/material_fab.dart","<p>Material FAB is a Floating Action Button. It is round, and behaves mostly\nthe same as a MaterialButton.</p>\n<p>It may be flat or raised. A raised button is styled with a shadow.</p>\n<p><strong>Example usage:</strong></p>\n<pre><code>&lt;!-- A Floating Action Button (FAB). --&gt;\n&lt;material-fab aria-label=\"add\"&gt;\n  &lt;material-icon icon=\"add\"&gt;&lt;/material-icon&gt;\n&lt;/material-fab&gt;\n</code></pre>\n<p><strong>Properties:</strong></p><ul><li><code>disabled: bool</code> -- Whether the button should not respond to events, and\nhave a style that suggests that interaction is not allowed.</li><li><code>raised: bool</code> -- Whether to have a box-shadow that makes the button look\nraised.</li></ul>\n<p><strong>Events:</strong></p><ul><li><code>trigger: Event</code> -- Published when the button is activated via click or\nkeypress.</li></ul>\n<p><strong>Styling:</strong></p>\n<p>The preferred way of specifying FAB colors is to use mixins:</p>\n<pre><code>/* Make #myButton green with yellow icon */\n@include button-background-color('#myButton', green);\n@include icon-button-color('#myButton', yellow);\n</code></pre>\n<p>The advantage of using mixins for color is that they will not overwrite the\ndisabled state colors. You can also style the FAB with CSS as you would a\nnormal DOM element, although this will also affect the disabled state:</p>\n<pre><code>/* Make #myButton green with yellow icon */\n#myButton {\n  background: green;\n  color: yellow;\n}\n</code></pre>\n<p>By default the ripple is the same color as the foreground at 25% opacity.\nYou may customize the color using this selector:</p>\n<pre><code>/* Make #myButton use a blue ripple instead of foreground color */\n#myButton material-ripple {\n  color: blue;\n}\n</code></pre>\n<p>The opacity of the ripple is not customizable via CSS.</p>\n")],[],P.e(),[]))
